public class InnerCapabilityEdiConfigurationFactory(Action<Humidifier.B2BI.CapabilityTypes.EdiConfiguration> factoryAction = null) : SubResourceFactory<Humidifier.B2BI.CapabilityTypes.EdiConfiguration>
{

    internal InnerCapabilityEdiTypeFactory TypeFactory { get; set; }

    internal InnerCapabilityS3LocationFactory InputLocationFactory { get; set; }

    internal InnerCapabilityS3LocationFactory OutputLocationFactory { get; set; }

    protected override Humidifier.B2BI.CapabilityTypes.EdiConfiguration Create()
    {
        var ediConfigurationResult = CreateEdiConfiguration();
        factoryAction?.Invoke(ediConfigurationResult);

        return ediConfigurationResult;
    }

    private Humidifier.B2BI.CapabilityTypes.EdiConfiguration CreateEdiConfiguration()
    {
        var ediConfigurationResult = new Humidifier.B2BI.CapabilityTypes.EdiConfiguration();

        return ediConfigurationResult;
    }
    public override void CreateChildren(Humidifier.B2BI.CapabilityTypes.EdiConfiguration result)
    {
        base.CreateChildren(result);

        result.Type ??= TypeFactory?.Build();
        result.InputLocation ??= InputLocationFactory?.Build();
        result.OutputLocation ??= OutputLocationFactory?.Build();
    }

} // End Of Class

